When you have a component or resource , that is larger struct with multiple fields, sometimes you want to borrow several of the fields at the same time, possibly mutably. struct MyThing { a: Foo, b: Bar,
} fn my_system(mut q: Query<&mut MyThing>) { for thing in q.iter_mut() { helper_func(&thing.a, &mut thing.b); // ERROR! }
} fn helper_func(foo: &Foo, bar: &mut Bar) { // do something
} This can result in a compiler error about conflicting borrows: error[E0502]: cannot borrow `thing` as mutable because it is also borrowed as immutable | | helper_func(&thing.a, &mut thing.b); // ERROR! | ----------- ----- ^^^^^ mutable borrow occurs here | | | | | immutable borrow occurs here | immutable borrow later used by call The solution is to use the "reborrow" idiom, a common but non-obvious trick in Rust programming: // add this at the start of the for loop, before using `thing`: let thing = &mut *thing; Note that this line triggers change detection . Even if you don't modify the data afterwards, the component gets marked as changed.

