Relevant official examples: transform , translation , rotation , 3d_rotation , scale , move_sprite , parenting , anything that spawns 2D or 3D objects. First, a quick definition, if you are new to game development: a Transform is what allows you to place an object in the game world. It is a combination of the object's "translation" (position/coordinates), "rotation", and "scale" (size adjustment). You move objects around by modifying the translation, rotate them by modifying the rotation, and make them larger or smaller by modifying the scale. // To simply position something at specific coordinates
let xf_pos567 = Transform::from_xyz(5.0, 6.0, 7.0); // To scale an object, making it twice as big in all dimensions
let xf_scale = Transform::from_scale(Vec3::splat(2.0)); // To rotate an object in 2D (Z-axis rotation) by 30°
// (angles are in radians! must convert from degrees!)
let xf_rot2d = Transform::from_rotation(Quat::from_rotation_z((30.0_f32).to_radians())); // 3D rotations can be complicated; explore the methods available on `Quat` // Simple 3D rotation by Euler-angles (X, Y, Z)
let xf_rot2d = Transform::from_rotation(Quat::from_euler( EulerRot::XYZ, (20.0_f32).to_radians(), (10.0_f32).to_radians(), (30.0_f32).to_radians(),
)); // Everything:
