Beware: The two components are synchronized by a bevy-internal system (the "transform propagation system"), which runs in the PostUpdate stage . When you mutate the Transform , the GlobalTransform is not updated immediately. They will be out-of-sync until the transform propagation system runs. If you need to work with GlobalTransform directly, you should add your system to the PostUpdate stage and order it after the TransformSystem::TransformPropagate label . /// Print the up-to-date global coordinates of the player as of **this frame**.
fn debug_globaltransform( query: Query<&GlobalTransform, With<Player>>,
) { let gxf = query.single(); debug!("Player at: {:?}", gxf.translation());
} fn main() { // the label to use for ordering use bevy::transform::TransformSystem; App::new() .add_plugins(DefaultPlugins) .add_system_to_stage( CoreStage::PostUpdate, debug_globaltransform .after(TransformSystem::TransformPropagate) ) .run();
}

