Timer allows you to detect when a certain interval of time has elapsed. Timers have a set duration. They can be "repeating" or "non-repeating". Both kinds can be manually "reset" (start counting the time interval from the beginning) and "paused" (they will not progress even if you keep ticking them). Repeating timers will automatically reset themselves after they reach their set duration. Use .finished() to detect when a timer has reached its set duration. Use .just_finished(), if you need to detect only on the exact tick when the duration was reached. use std::time::Duration; #[derive(Component)]
struct FuseTime { /// track when the bomb should explode (non-repeating timer) timer: Timer,
} fn explode_bombs( mut commands: Commands, mut q: Query<(Entity, &mut FuseTime)>, time: Res<Time>,
) { for (entity, mut fuse_timer) in q.iter_mut() { // timers gotta be ticked, to work fuse_timer.timer.tick(time.delta()); // if it finished, despawn the bomb if fuse_timer.timer.finished() { commands.entity(entity).despawn(); } }
} #[derive(Resource)]
struct BombsSpawnConfig { /// How often to spawn a new bomb? (repeating timer) timer: Timer,
} /// Spawn a new bomb in set intervals of time
fn spawn_bombs( mut commands: Commands, time: Res<Time>, mut config: ResMut<BombsSpawnConfig>,
) { // tick the timer config.timer.tick(time.delta()); if config.timer.finished() { commands.spawn(( FuseTime { // create the non-repeating fuse timer timer: Timer::new(Duration::from_secs(5), TimerMode::Once), }, // ... other components ... )); }
} /// Configure our bomb spawning algorithm
fn setup_bomb_spawning( mut commands: Commands,
) { commands.insert_resource(BombsSpawnConfig { // create the repeating timer timer: Timer::new(Duration::from_secs(10), TimerMode::Repeating), })
} Note that Bevy's timers do not work like typical real-life timers (which count downwards toward zero). Bevy's timers start from zero and count up towards their set duration. They are basically like stopwatches with extra features: a maximum duration and optional auto-reset.

