Bevy assigns a unique ID ( Gamepad ) to each connected gamepad. This lets you associate the device with a specific player and distinguish which one your inputs are coming from. You can use the Gamepads resource to list the IDs of all the currently connected gamepad devices, or to check the status of a specific one. To detect when gamepads are connected or disconnected, you can use GamepadEvent events . Example showing how to remember the first connected gamepad ID: /// Simple resource to store the ID of the connected gamepad.
/// We need to know which gamepad to use for player input.
#[derive(Resource)]
struct MyGamepad(Gamepad); fn gamepad_connections( mut commands: Commands, my_gamepad: Option<Res<MyGamepad>>, mut gamepad_evr: EventReader<GamepadEvent>,
) { for ev in gamepad_evr.iter() { // the ID of the gamepad let id = ev.gamepad; match &ev.event_type { GamepadEventType::Connected(info) => { println!("New gamepad connected with ID: {:?}, name: {}", id, info.name); // if we don't have any gamepad yet, use this one if my_gamepad.is_none() { commands.insert_resource(MyGamepad(id)); } } GamepadEventType::Disconnected => { println!("Lost gamepad connection with ID: {:?}", id); // if it's the one we previously associated with the player, // disassociate it: if let Some(MyGamepad(old_id)) = my_gamepad.as_deref() { if *old_id == id { commands.remove_resource::<MyGamepad>(); } } } // other events are irrelevant _ => {} } }
}

