You can handle the analog sticks and triggers with Axis<GamepadAxis> ( Axis , GamepadAxis ). Buttons can be handled with Input<GamepadButton> ( Input , GamepadButton ), similar to mouse buttons or keyboard keys . Notice that the names of buttons in the GamepadButton are vendor-neutral (like South and East instead of X/O or A/B). fn gamepad_input( axes: Res<Axis<GamepadAxis>>, buttons: Res<Input<GamepadButton>>, my_gamepad: Option<Res<MyGamepad>>,
) { let gamepad = if let Some(gp) = my_gamepad { // a gamepad is connected, we have the id gp.0 } else { // no gamepad is connected return; }; // The joysticks are represented using a separate axis for X and Y let axis_lx = GamepadAxis { gamepad, axis_type: GamepadAxisType::LeftStickX }; let axis_ly = GamepadAxis { gamepad, axis_type: GamepadAxisType::LeftStickY }; if let (Some(x), Some(y)) = (axes.get(axis_lx), axes.get(axis_ly)) { // combine X and Y into one vector let left_stick_pos = Vec2::new(x, y); // Example: check if the stick is pushed up if left_stick_pos.length() > 0.9 && left_stick_pos.y > 0.5 { // do something } } // In a real game, the buttons would be configurable, but here we hardcode them let jump_button = GamepadButton { gamepad, button_type: GamepadButtonType::South }; let heal_button = GamepadButton { gamepad, button_type: GamepadButtonType::East }; if buttons.just_pressed(jump_button) { // button just pressed: make the player jump } if buttons.pressed(heal_button) { // button being held down: heal the player }
} You can also handle gamepad inputs using GamepadEvent events : fn gamepad_input_events( my_gamepad: Option<Res<MyGamepad>>, mut gamepad_evr: EventReader<GamepadEvent>,
) { let gamepad = if let Some(gp) = my_gamepad { // a gamepad is connected, we have the id gp.0 } else { // no gamepad is connected return; }; for ev in gamepad_evr.iter() { if ev.gamepad != gamepad { // event not from our gamepad continue; } use GamepadEventType::{AxisChanged, ButtonChanged}; match ev.event_type { AxisChanged(GamepadAxisType::RightStickX, x) => { // Right Stick moved (X) } AxisChanged(GamepadAxisType::RightStickY, y) => { // Right Stick moved (Y) } ButtonChanged(GamepadButtonType::DPadDown, val) => { // buttons are also reported as analog, so use a threshold if val > 0.5 { // button pressed } } _ => {} // don't care about other inputs } }
}

