You can use the GamepadSettings resource to configure dead-zones and other parameters of the various axes and buttons. You can set the global defaults, as well as individually per-axis/button. Here is an example showing how to configure gamepads with custom settings (not necessarily good settings, please don't copy these blindly): // this should be run once, when the game is starting
// (transition entering your in-game state might be a good place to put it)
fn configure_gamepads( my_gamepad: Option<Res<MyGamepad>>, mut settings: ResMut<GamepadSettings>,
) { let gamepad = if let Some(gp) = my_gamepad { // a gamepad is connected, we have the id gp.0 } else { // no gamepad is connected return; }; // add a larger default dead-zone to all axes (ignore small inputs, round to zero) settings.default_axis_settings.set_deadzone_lowerbound(-0.1); settings.default_axis_settings.set_deadzone_upperbound(0.1); // make the right stick "binary", squash higher values to 1.0 and lower values to 0.0 let mut right_stick_settings = AxisSettings::default(); right_stick_settings.set_deadzone_lowerbound(-0.5); right_stick_settings.set_deadzone_upperbound(0.5); right_stick_settings.set_livezone_lowerbound(-0.5); right_stick_settings.set_livezone_upperbound(0.5); // the raw value should change by at least this much, // for Bevy to register an input event: right_stick_settings.set_threshold(0.01); // make the triggers work in big/coarse steps, to get fewer events // reduces noise and precision let mut trigger_settings = AxisSettings::default(); trigger_settings.set_threshold(0.25); // set these settings for the gamepad we use for our player settings.axis_settings.insert( GamepadAxis { gamepad, axis_type: GamepadAxisType::RightStickX }, right_stick_settings.clone() ); settings.axis_settings.insert( GamepadAxis { gamepad, axis_type: GamepadAxisType::RightStickY }, right_stick_settings.clone() ); settings.axis_settings.insert( GamepadAxis { gamepad, axis_type: GamepadAxisType::LeftZ }, trigger_settings.clone() ); settings.axis_settings.insert( GamepadAxis { gamepad, axis_type: GamepadAxisType::RightZ }, trigger_settings.clone() ); // for buttons (or axes treated as buttons): let mut button_settings = ButtonSettings::default(); // require them to be pressed almost all the way, to count button_settings.set_press_threshold(0.9); // require them to be released almost all the way, to count button_settings.set_release_threshold(0.1); settings.default_button_settings = button_settings;
}

