Relevant official examples: drag_and_drop . Bevy supports the Drag-and-Drop gesture common on most desktop operating systems, but only for files, not arbitrary data / objects. If you drag a file (say, from the file manager app) into a Bevy app, Bevy will produce a FileDragAndDrop event , containing the path of the file that was dropped in. Usually, in a graphical app, you may want to do different things depending on where it was dropped. For this, you can check the mouse cursor position , or use a Bevy UI Interaction . For example, here is how to detect if a file was dropped onto a special UI widget/element (which we identify with a custom marker component ): #[derive(Component)]
struct MyDropTarget; fn file_drop( mut dnd_evr: EventReader<FileDragAndDrop>, query_ui_droptarget: Query<&Interaction, With<MyDropTarget>>,
) { for ev in dnd_evr.iter() { println!("{:?}", ev); if let FileDragAndDrop::DroppedFile { id, path_buf } = ev { println!("Dropped file with path: {:?}", path_buf); if id.is_primary() { // it was dropped over the main window } for interaction in query_ui_droptarget.iter() { if *interaction == Interaction::Hovered { // it was dropped over our UI element // (our UI element is being hovered over) } } } }
}

