} fn main() { App::new() // set the global default .insert_resource(ClearColor(Color::rgb(0.9, 0.3, 0.6))) .add_plugins(DefaultPlugins) .add_startup_system(setup) .run();
} To override the default and use a different color for a specific camera, you can set it using the Camera2d or Camera3d components. use bevy::core_pipeline::clear_color::ClearColorConfig; fn setup_camera_2d( mut commands: Commands,
) { // set the color for a specific camera (2D) commands.spawn(Camera2dBundle { camera_2d: Camera2d { clear_color: ClearColorConfig::Custom(Color::rgb(0.8, 0.4, 0.2)), }, ..Default::default() });
