The simplest use case is to just load a "3D model" and spawn it into the game world. "3D models" can often be complex, consisting of multiple parts. Think of a house: the windows, roof, doors, etc., are separate pieces, that are likely made of multiple meshes, materials, and textures. Bevy would technically need multiple ECS Entities to represent and render the whole thing. This is why your GLTF "model" is represented by Bevy as a [Scene][cb::scene]. This way, you can easily spawn it, and Bevy will create all the relevant child entities and configure them correctly. fn spawn_gltf( mut commands: Commands, ass: Res<AssetServer>,
) { // note that we have to include the `Scene0` label let my_gltf = ass.load("my.glb#Scene0"); // to position our 3d model, simply use the Transform // in the SceneBundle commands.spawn(SceneBundle { scene: my_gltf, transform: Transform::from_xyz(2.0, 0.0, -5.0), ..Default::default() });
} You could also use GLTF files to load an entire map/level. It works the same way. The above example assumes that you have a simple GLTF file containing only one "default scene". GLTF is a very flexible file format. A single file can contain many "models" or more complex "scenes". To get a better understanding of GLTF and possible workflows, read the rest of this page. :)

