If you have a complex GLTF file, this is likely the most flexible and useful way of navigating its contents and using the different things inside. You have to wait for the GLTF file to load, and then use the Gltf asset. use bevy::gltf::Gltf; /// Helper resource for tracking our asset
#[derive(Resource)]
struct MyAssetPack(Handle<Gltf>); fn load_gltf( mut commands: Commands, ass: Res<AssetServer>,
) { let gltf = ass.load("my_asset_pack.glb"); commands.insert_resource(MyAssetPack(gltf));
} fn spawn_gltf_objects( mut commands: Commands, my: Res<MyAssetPack>, assets_gltf: Res<Assets<Gltf>>,
) { // if the GLTF has loaded, we can navigate its contents if let Some(gltf) = assets_gltf.get(&my.0) { // spawn the first scene in the file commands.spawn(SceneBundle { scene: gltf.scenes[0].clone(), ..Default::default() }); // spawn the scene named "YellowCar" commands.spawn(SceneBundle { scene: gltf.named_scenes["YellowCar"].clone(), transform: Transform::from_xyz(1.0, 2.0, 3.0), ..Default::default() }); // PERF: the `.clone()`s are just for asset handles, don't worry :) }
} For a more convoluted example, say we want to directly create a 3D PBR entity, for whatever reason. (This is not recommended; you should probably just use scenes) use bevy::gltf::GltfMesh; fn gltf_manual_entity( mut commands: Commands, my: Res<MyAssetPack>, assets_gltf: Res<Assets<Gltf>>, assets_gltfmesh: Res<Assets<GltfMesh>>,
) { if let Some(gltf) = assets_gltf.get(&my.0) { // Get the GLTF Mesh named "CarWheel" // (unwrap safety: we know the GLTF has loaded already) let carwheel = assets_gltfmesh.get(&gltf.named_meshes["CarWheel"]).unwrap(); // Spawn a PBR entity with the mesh and material of the first GLTF Primitive commands.spawn(PbrBundle { mesh: carwheel.primitives[0].mesh.clone(), // (unwrap: material is optional, we assume this primitive has one) material: carwheel.primitives[0].material.clone().unwrap(), ..Default::default() }); }
}

