This is another way to access specific sub-assets. It is less reliable, but may be easier to use in some cases. Use the AssetServer to convert a path string into a Handle . The advantage is that you can get handles to your sub-assets immediately, even if your GLTF file hasn't loaded yet. The disadvantage is that it is more error-prone. If you specify a sub-asset that doesn't actually exist in the file, or mis-type the label, or use the wrong label, it will just silently not work. Also, currently only using a numerial index is supported. You cannot address sub-assets by name. fn use_gltf_things( mut commands: Commands, ass: Res<AssetServer>,
) { // spawn the first scene in the file let scene0 = ass.load("my_asset_pack.glb#Scene0"); commands.spawn(SceneBundle { scene: scene0, ..Default::default() }); // spawn the second scene let scene1 = ass.load("my_asset_pack.glb#Scene1"); commands.spawn(SceneBundle { scene: scene1, transform: Transform::from_xyz(1.0, 2.0, 3.0), ..Default::default() });
} The following asset labels are supported ({} is the numerical index): Scene{}: GLTF Scene as Bevy Scene Node{}: GLTF Node as GltfNode Mesh{}: GLTF Mesh as GltfMesh Mesh{}/Primitive{}: GLTF Primitive as Bevy Mesh Texture{}: GLTF Texture as Bevy Image Material{}: GLTF Material as Bevy StandardMaterial DefaultMaterial: as above, if the GLTF file contains a default material with no index Animation{}: GLTF Animation as Bevy AnimationClip Skin{}: GLTF mesh skin as Bevy SkinnedMeshInverseBindposes The GltfNode and GltfMesh asset types are only useful to help you navigate the contents of your GLTF file. They are not core Bevy renderer types, and not used by Bevy in any other way. The Bevy renderer expects Entities with MaterialMeshBundle ; for that you need the Mesh and StandardMaterial .

