You can simply create a new Rust project, either from your IDE/editor, or the commandline: cargo new --bin my_game (creates a project called my_game) The Cargo.toml file contains all the configuration of your project. Add the latest version of bevy as a dependency. Your file should now look something like this: [package]
name = "my_game"
version = "0.1.0"
edition = "2021" [dependencies]
bevy = "0.9" The src/main.rs file is your main source code file. This is where you start writing your Rust code. For a minimal Bevy app , you need at least the following: use bevy::prelude::*; fn main() { App::new() .add_plugins(DefaultPlugins) .run();
} You can now compile and run your project. The first time, this will take a while, as it needs to build the whole Bevy engine and dependencies. Subsequent runs should be fast. You can do this from your IDE/editor, or the commandline: cargo run
